import React, { Component } from "react";
import RegistrationForm from "./RegistrationForm";
import EventSummary from "./EventSummary";

class RegistrationPage extends Component {

    constructor(props) {
        super(props);
        console.log(this.props); // props will get logged.
        this.state = {
          all_events: [],
        };
    }

    componentDidMount() {
        console.log("mounting");
        // console.log(all_events);
        this.loadEvents();
      }
    
    loadEvents() {
          // axios.get(
          //   "http://localhost:5000/events").then((res) => {
          //     this.setState({
          //       all_events: res.data.reverse(),
          //     });
          //   });
    
        this.setState({
          all_events: [
            {
              "id": 1,
              "organizer_employee_id": "jane.doe",
              "name": "Volunteering Activity @ Sun Plaza Park",
              "date": "20/03/2021",
              "time": "09:00 AM– 11:00 AM",
              "location": "407 Tampines Street 41 Sun Plaza Green Singapore 520407",
              "info_for_participants": "The event will be cancelled in the event of wet weather.",
              "registration_opens_on": "2021-01-10T00:00:00",
              "registration_closes_on": "2021-03-17T00:00:00",
              "capacity": 10,
              "fill": 2,
              "image": "https://pbs.twimg.com/media/Dap2TNXWAAAXn8i.jpg",
              "tags": "outdoor"
            }
          ],
        });
        console.log(this.state.all_events)
      }


    render() {
        return (
            <div>
                {/* Show summary of event */}
                <div className="container mx-auto flex justify-around flex-wrap pt-4 pb-12">
                    {this.state.all_events.map((event) => (
                        <EventSummary event={event} key={event.id} />
                    ))}
                </div>

                {/* Sign up form */}
                <div className="container mx-auto flex justify-around flex-wrap pt-4 pb-12">
                    <RegistrationForm />
                </div>
            </div>
        );
    }
}

export default RegistrationPage;
